PREFIX epd: <http://data.europa.eu/a4g/resource/>

ASK {
  SELECT ?this WHERE {
    {
      SELECT ?this (COUNT(?someValue) AS ?vCount)  WHERE {
      { ?this ?outProp ?someValue.
        FILTER isIRI(?someValue)
      }
      UNION
      { ?someValue ?inProp ?this.
      }

      FILTER strstarts(str(?this),str(epd:)).
      FILTER strstarts(str(?someValue),str(epd:)).
      } GROUP BY ?this
    }
    FILTER (?vCount > 0)
  }
}

PREFIX epd: <http://data.europa.eu/a4g/resource/>

ASK {
SELECT ?this WHERE {
    {
      SELECT ?this (COUNT(?someValue) AS ?vCount)  WHERE {
        ?this ?property ?someValue.
  		FILTER strstarts(str(?this),str(epd:)).
      } GROUP BY ?this
    }
    FILTER ((EXISTS {?this a ?class}) && ?vCount > 1)
}
}

PREFIX epo: <http://data.europa.eu/a4g/ontology#>
PREFIX locn: <http://www.w3.org/ns/locn#>
PREFIX cccev: <http://data.europa.eu/m8g/>

ASK {
  {
    SELECT (COUNT(?s) AS ?cNoLangTag) WHERE {
      VALUES ?property {epo:hasLegalName epo:hasContactName
            epo:hasTitle epo:hasDescription epo:hasAdditionalInformation epo:hasOptionsDescription
            locn:fullAddress cccev:name cccev:weight cccev:description}
      ?s ?property ?value
      FILTER (lang(?value) = "")
    }
  }
  FILTER (?cNoLangTag = 0)
}

PREFIX epo: <http://data.europa.eu/a4g/ontology#>

ASK {
  {
    SELECT (COUNT(?instance) AS ?cAllInst) {
      ?instance a epo:SubmissionStatisticalInformation.
    }
  }

  {
    SELECT (COUNT(?instance) AS ?cInstancesWithNewLinks) {
      SELECT ?instance WHERE {
        ?instance a epo:SubmissionStatisticalInformation.
        ?instance epo:summarisesInformationForLotAwardOutcome ?value.
        ?value a epo:LotAwardOutcome.
      } GROUP BY ?instance
    }
  }

  {
    SELECT (COUNT(?instance) AS ?cInstancesWithOldLinks) {
      SELECT ?instance WHERE {
        VALUES ?p {epo:summarisesInformationForLotAwardOutcome epo:concernsSubmissionsForLot}
        ?instance a epo:SubmissionStatisticalInformation.
        ?instance ?p ?value.
        ?value a ?class
        FILTER (?class = epo:Lot || ?p = epo:concernsSubmissionsForLot)
      } GROUP BY ?instance
    }
  }

  FILTER (?cAllInst = ?cInstancesWithNewLinks && ?cInstancesWithOldLinks = 0)
}

