PREFIX epo: <http://data.europa.eu/a4g/ontology#>

ASK {
   {
    SELECT (COUNT(?sub) AS ?instanceCount) {
      {
       SELECT ?sub (COUNT(?obj) AS ?pCount) WHERE {
         ?sub epo:hasID ?obj .
         ?obj a epo:Identifier .
       }
       GROUP BY ?sub
      }
      FILTER (?pCount > 1)
    }
   }
   FILTER(?instanceCount = 0)
}
